import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const PortfolioSection = () => {
  const [selectedCar, setSelectedCar] = useState(0);

  const portfolioItems = [
    {
      car: 'Mercedes-Benz GLE Coupe',
      image: 'https://purepng.com/public/uploads/large/purepng.com-mercedes-benz-gle-coupe-white-carcarvehicletransportmercedes-benz-961524660217nch4l.png',
      stats: [
        { label: 'Interior', value: 'Gold' },
        { label: 'Exterior', value: 'Gold' },
        { label: 'Duration', value: '1 hrs' },
      ],
      workImages: [
        { src: './BENZ-INTERIOR.jpg', alt: 'Interior detailing' },
        { src: './BENZ-EXTERIOR.jpg', alt: 'Exterior polishing' },
        { src: './BENZ-WHEELS.jpg', alt: 'Wheel cleaning' },
      ],
    },
    {
      car: 'Mercedes-CLA 45 AMG',
      image: 'https://platform.cstatic-images.com/xlarge/in/v2/stock_photos/0aab52e8-297d-4304-a1dc-ea2dcf3b65e6/385d51be-3d92-4a51-ad20-16bab630ae7b.png',
      stats: [
        { label: 'Interior', value: 'Gold' },
        { label: 'Exterior', value: 'Gold' },
        { label: 'Duration', value: '1 hrs' },
      ],
      workImages: [
        { src: 'https://scontent.xx.fbcdn.net/v/t1.15752-9/450632196_1603926973673510_1096078428820427319_n.jpg?stp=dst-jpg_s403x403&_nc_cat=107&ccb=1-7&_nc_sid=0024fc&_nc_ohc=YX7nPtxEVHcAX8v7kNv&_nc_ad=z-m&_nc_cid=0&_nc_ht=scontent.xx&oh=03_AdRkOuAoTwzlIMcMbq6fKuFwWXeERZUl3zCJOEY6P9yiGA&oe=65A11E8E', alt: 'Interior detailing' },
        { src: 'https://scontent.xx.fbcdn.net/v/t1.15752-9/450519791_999205935028547_2278220323279530740_n.jpg?stp=dst-jpg_s403x403&_nc_cat=108&ccb=1-7&_nc_sid=0024fc&_nc_ohc=-KCKwcnsGv0AX8v7kNv&_nc_ad=z-m&_nc_cid=0&_nc_ht=scontent.xx&oh=03_AdRSbz2IjDNtURWNJJWP2OQQbJnbB_ZnbPFtU2s6F0-IpQ&oe=65A12341', alt: 'Exterior polishing' },
        { src: 'https://scontent.xx.fbcdn.net/v/t1.15752-9/449413277_495631499799231_8720280807108761436_n.jpg?stp=dst-jpg_s403x403&_nc_cat=108&ccb=1-7&_nc_sid=0024fc&_nc_ohc=la9wzyT1t4YAX8v7kNv&_nc_ad=z-m&_nc_cid=0&_nc_ht=scontent.xx&oh=03_AdT4cQpMlOk9EPYg3jv3X5IqfV7sAtD7Dv7oMJCLhIUQHQ&oe=65A13209', alt: 'Wheel cleaning' },
      ],
    },
  ];

  const pageVariants = {
    initial: { opacity: 0, y: 50 },
    in: { opacity: 1, y: 0 },
    out: { opacity: 0, y: -50 },
  };

  const pageTransition = {
    type: 'tween',
    ease: 'anticipate',
    duration: 0.5,
  };

  return (
    <motion.div
      initial="initial"
      animate="in"
      exit="out"
      variants={pageVariants}
      transition={pageTransition}
      className="flex flex-col min-h-screen text-neutral-800 p-4 sm:p-6 md:p-8 lg:p-12"
    >
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: -50 }}
        transition={{ duration: 0.8 }}
        className="mb-4 sm:mb-6 md:mb-8"
      >
        <span className="text-4xl sm:text-5xl md:text-6xl font-bold text-neutral-400">03</span>
      </motion.div>
      <motion.h2
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: -50 }}
        transition={{ duration: 0.8, delay: 0.2 }}
        className="text-3xl sm:text-4xl md:text-5xl font-bold mb-6 sm:mb-8 md:mb-12"
      >
        Our Work.
      </motion.h2>

      <div className="flex flex-col md:flex-row justify-between items-start md:items-center mb-6 sm:mb-8">
        <AnimatePresence mode="wait">
          <motion.h3 
            className="text-2xl sm:text-3xl md:text-4xl font-bold mb-4 md:mb-0"
            key={selectedCar}
            initial={{ opacity: 0, x: -50 }}
            animate={{ opacity: 1, x: 0 }}
            exit={{ opacity: 0, x: 50 }}
            transition={{ duration: 0.5 }}
          >
            {portfolioItems[selectedCar].car}
          </motion.h3>
        </AnimatePresence>
      </div>

      <div className="flex flex-col md:flex-row justify-between mb-8 md:mb-12">
        <div className="w-full md:w-1/4 mb-4 md:mb-0">
          {portfolioItems.map((item, index) => (
            <motion.div
              key={index}
              className={`cursor-pointer mb-2 ${selectedCar === index ? 'text-blue-600' : 'text-neutral-600'}`}
              onClick={() => setSelectedCar(index)}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              {item.car}
            </motion.div>
          ))}
        </div>
        <div className="w-full md:w-1/2 relative h-48 sm:h-64 md:h-80 mb-4 md:mb-0">
          <AnimatePresence mode="wait">
            <motion.img
              key={selectedCar}
              src={portfolioItems[selectedCar].image}
              alt={portfolioItems[selectedCar].car}
              className="w-full h-full object-cover absolute rounded-lg"
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              exit={{ opacity: 0, scale: 0.8 }}
              transition={{ duration: 0.5 }}
            />
          </AnimatePresence>
        </div>
        <div className="w-full md:w-1/4">
          <AnimatePresence>
            {portfolioItems[selectedCar].stats.map((stat, index) => (
              <motion.div 
                key={index} 
                className="mb-2 sm:mb-4"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                exit={{ opacity: 0, y: -20 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                <div className="text-sm text-neutral-600">{stat.label}</div>
                <div className="text-xl sm:text-2xl font-bold">{stat.value}</div>
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4">
        <AnimatePresence>
          {portfolioItems[selectedCar].workImages.map((img, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              exit={{ opacity: 0, scale: 0.8 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <motion.img
                src={img.src}
                alt={img.alt}
                className="w-full h-32 sm:h-40 md:h-48 object-cover rounded-lg"
                whileHover={{ scale: 1.05 }}
              />
            </motion.div>
          ))}
        </AnimatePresence>
      </div>
    </motion.div>
  );
};

export default PortfolioSection;
